\parbox{7cm}{\sffamily
\textbf{Seafloor and target model}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Patch- or pixel-based 3D shape
\item Arbitrary position and orientation
\item Adjustable reflectivity
\end{itemize}}

\parbox{5cm}{\sffamily
\textbf{Sonar}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Position and orientation
\item Monostatic
\end{itemize}}

\parbox{5cm}{\sffamily
\textbf{Image}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Intensity only (real)
\item Arbitrary resolution and size
\end{itemize}}

\parbox{9cm}{\sffamily
\textbf{Generally}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item We want accurate templates at high speed (real-time?)
\end{itemize}}
